bool calculateDistance(int x1, int y1, int x2, int y2) {
    int dx = x2 - x1;
    int dy = y2 - y1;
    int dist = sqrt(dx * dx + dy * dy); // Euclidean distance formula
	if(dist < 20){
		return true;
	} else {
		return false;
	}
}

